import React from 'react'
import './styles.css'
import '../App.css'

function Service() {

    function handleClick(e) {
        this.props.setFormStep(1)
    }

    return (
        <div className="authBox">
            <h1>Choose a service</h1>
            <div className="servicesBox">
                <input className="btn-primary" type="submit" value="Water tank fill" onClick={handleClick}/>
                <input className="btn-primary" type="submit" value="Water tank cleaning" onClick={handleClick}/>
            </div>

        </div>
    )
}

export default Service
